class TinhTong
{
    static string tinhtong(string str1, string str2)
    {
        if (str1.Length > str2.Length)
        {
            string t = str1;
            str1 = str2;
            str2 = t;
        }
        string str = "";

        int n1 = str1.Length;
        int n2 = str2.Length;
        int diff = n2 - n1;
        int ascii = 48;
        int carry = 0;

        for (int i = n1 - 1; i >= 0; i--)
        {
            int sum = ((str1[i] - ascii) + (str2[i + diff] - ascii) + carry);
            str += (char)(sum % 10 + ascii);
            carry = sum / 10;
        }


        for (int i = n2 - n1 - 1; i >= 0; i--)
        {
            int sum = ((str2[i] - ascii) + carry);
            str += (char)(sum % 10 + ascii);
            carry = sum / 10;
        }


        if (carry > 0)
            str += (char)(carry + ascii);


        char[] ch2 = str.ToCharArray();
        Array.Reverse(ch2);
        return new string(ch2);
    }
    static string tru(string str1, string str2)
    {
        if (str1.Length > str2.Length)
        {
            string t = str1;
            str1 = str2;
            str2 = t;
        }
        string str = "";

        int n1 = str1.Length;
        int n2 = str2.Length;
        int diff = n2 - n1;
        int ascii = 48;
        int carry = 0;

        for (int i = n1 - 1; i >= 0; i--)
        {
            int minus = 0;
            if ((str2[i + diff] - ascii) - (str1[i] - ascii) < 0)
            {
                minus = (str2[i + diff] - ascii + 10) - (str1[i] - ascii) - carry;
                carry = 1;
            }
            else
            {
                minus = (str2[i + diff] - ascii) - (str1[i] - ascii) - carry;
                carry = 0;
            }
            str += (char)(minus % 10 + ascii);
        }


        for (int i = n2 - n1 - 1; i >= 0; i--)
        {
            int sum = ((str2[i] - ascii) + carry);
            str += (char)(sum % 10 + ascii);
            carry = sum / 10;
        }


        if (carry > 0)
            str += (char)(carry + ascii);


        char[] ch2 = str.ToCharArray();
        Array.Reverse(ch2);
        return new string(ch2);
    }

